import logo from "./logo.svg";
import "./App.css";
import IndianTimeDisplay from "./Components/IndianTimeDisplay/IndianTimeDisplay";
import Hong_Us from "./Components/Hong_Us/Hong_Us";
import CustomInput from "./Components/CustomInput/CustomInput";
import Navbar from "./Components/Navbar/Navbar";

function App() {
  return (
    <div className="App">
      <Navbar />
      <div className="time-container">
        <IndianTimeDisplay />
        <Hong_Us />
      </div>
      <CustomInput />
    </div>
  );
}

export default App;
